import React from "react";
import { Container, Button } from "../index";
import "./style.scss";

function Hero() {
	return (
		<div className="hero">
			<Container>
				<p>Hero title</p>
				<p>Hero copy</p>
				<Button />
			</Container>
		</div>
	);
}

export default Hero;
